    true,nt"url": null,nt"notes": "The Environmental Agent Service (EAS) Registries
    is the information system encompassing the Ionizing Radiation Registry (IRR), the
    Agent Orange Registry (AOR), and the Gulf War Registry (GWR) which also includes
    related Depleted Uranium (DU) exams.  These registries were originally developed
    using paper code sheets that were sent to the VA Austin Information Technology Center
    where typists converted to data files on the mainframe. The Registries have undergone
    a modernization and simplification effort that allows the entry of data via a web
    interface at https://vaww.registries.aac.va.gov/eas/ by staff at the VA medical
    centers. In compliance with the Federal Information Systems Management Act (FISMA)
    this is considered a single system of records with the three registry components
    i.e. IRR, AOR, GWR with DU that have been integrated into a single Oracle database.
     Please see individual Monograph entries for specific details on:  Ionizing Radiation
